import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/RegisterPage.css";

export default function RegisterPage() {
  const [form, setForm] = useState({
    userId: "",
    password: "",
    email: "",
    nickname: "",
    age: "",
    region: "",
    phone: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) =>
    setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`${form.nickname}님, 회원가입이 완료되었습니다!`);
    navigate("/");
  };

  return (
    <div className="register-page-container">
      <div className="register-card">
        <h1>회원가입 페이지</h1>
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            name="userId"
            placeholder="아이디"
            value={form.userId}
            onChange={handleChange}
            required
          />
          <input
            type="password"
            name="password"
            placeholder="비밀번호"
            value={form.password}
            onChange={handleChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="이메일"
            value={form.email}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="nickname"
            placeholder="닉네임"
            value={form.nickname}
            onChange={handleChange}
            required
          />
          <input
            type="number"
            name="age"
            placeholder="나이"
            value={form.age}
            onChange={handleChange}
          />
          <input
            type="text"
            name="region"
            placeholder="지역"
            value={form.region}
            onChange={handleChange}
          />
          <input
            type="text"
            name="phone"
            placeholder="전화번호"
            value={form.phone}
            onChange={handleChange}
          />
          <button type="submit" className="register-btn">
            가입하기
          </button>
        </form>
      </div>
    </div>
  );
}
